Source: HOCPO Farm, n.d.
As stated in DA-BFAR FAO No. 214 Series of 2001 Code of Practice for
Aquaculture, potential sites for aquaculture are thoroughly evaluated by DA-BFAR
to ensure that ecological and social conditions are sustained and protected. The
following practices ensure that the sites selected are appropriate for aquaculture
farms:
Water source in the area shall be evaluated as to its quality and quantity;
Tidal patterns, freshwater influences, flood levels, offshore currents, and
existing water uses shall be determined;
Sustainability of topography, soil, and ecosystem for siting and
construction of ponds shall be ascertained;
Long-term climatological records for the last five years shall be acquired to
determine the occurrence of floods, droughts, storms, and other calamities
in the area;
Existing flora and fauna shall be determined relative to ecologically
sensitive areas such as migration routes, nesting grounds, etc.;
